import { HalfMoon, Container } from "./styles";
import logo from "../../assets/logo-dynamox.png"
const Header = () => {
  return (
    <Container>
      <div className="left">
        <img src={logo} href="https://dynamox.net/"></img>
      </div>


      <div className="right">
        <a href="https://dynamox.net/">DynaPredict</a>
        <a>Sensores</a>
        <a>Contato</a>
      </div>
    </Container>
  );
};

export default Header;
